// ==UserScript==
// @name     selecteer CPU's met een hogere mark
// @version  1
// @grant    none
// @include https://tweakers.net/laptops/vergelijken/*
// @require      https://cdn.jsdelivr.net/npm/pako@1.0.11/dist/pako.min.js
// ==/UserScript==

const cpu_data_base64_and_compressed  = "";

const cpu_data = JSON.parse(pako.inflate(atob(cpu_data_base64_and_compressed), { to: 'string' }));// [{'cpu_name':cpu_name,'cpu_mark':cpu_mark,'rank':rank}]



function searchForCpuSoc() {
    const title = 'title="Cpu/soc"'

    const h4Elements = document.querySelectorAll('h4[title="Cpu/soc"]');
    
    return h4Elements[0].parentNode.parentNode;
}

function getSelectedCpus() {
    const cpuSoc = searchForCpuSoc();

    const parentToOptions = cpuSoc.querySelector('div#specificationFilter_3342');

    const options = parentToOptions.querySelector('div.options');

    const twoOptionsContainerul = options.querySelectorAll('ul');

    let cpuNames = [];


    for (let i = 0; i < twoOptionsContainerul.length; i++) {
        const ul = twoOptionsContainerul[i];
        const listItems = ul.querySelectorAll('li');

        listItems.forEach(li => {
            const input = li.querySelector('input');
            if (input.checked) {
                const cpu_name = li.querySelector('span.facetLabel').textContent.trim();

                cpuNames.push(cpu_name);
            }
        });
    }

    return cpuNames;
}


function getCpusWithHigherRank() {
    const selectedCpus = getSelectedCpus();

    let selectedCpusMark = [];

    for (let i = 0; i < cpu_data.length; i++) {
        const cpu = cpu_data[i];
        if (selectedCpus.includes(cpu.cpu_name)) {
            selectedCpusMark.push(cpu);
        }
    }

    let result = [];

    // get all cpus in the cpu_data that have a higher rank than the selected ones
    
    for (let i = 0; i < cpu_data.length; i++) {
        const cpu = cpu_data[i];
        for (let j = 0; j < selectedCpusMark.length; j++) {
            const selectedCpu = selectedCpusMark[j];
            if (cpu.rank < selectedCpu.rank) {
                result.push(cpu.cpu_name);
            }
        }
    }


    return result;
}

function selectCpusWithHigherRank() {
    const cpusWithHigherRank = getCpusWithHigherRank();

    const cpuSoc = searchForCpuSoc();

    const parentToOptions = cpuSoc.querySelector('div#specificationFilter_3342');

    const options = parentToOptions.querySelector('div.options');

    const twoOptionsContainerul = options.querySelectorAll('ul');

    for (let i = 0; i < twoOptionsContainerul.length; i++) {
        const ul = twoOptionsContainerul[i];
        const listItems = ul.querySelectorAll('li');

        listItems.forEach(li => {
            const cpu_name = li.querySelector('span.facetLabel').textContent.trim();
            if (cpusWithHigherRank.includes(cpu_name)) {
                const input = li.querySelector('input');
                console.log(cpu_name);

                if (input.checked === false) {
                    input.click();
                }
            }
        });
    }
}

function unselectAllCpus() {
    const cpuSoc = searchForCpuSoc();

    const parentToOptions = cpuSoc.querySelector('div#specificationFilter_3342');

    const options = parentToOptions.querySelector('div.options');

    const twoOptionsContainerul = options.querySelectorAll('ul');

    for (let i = 0; i < twoOptionsContainerul.length; i++) {
        const ul = twoOptionsContainerul[i];
        const listItems = ul.querySelectorAll('li');

        listItems.forEach(li => {
            const input = li.querySelector('input');
            if (input.checked) {
                input.click();
            }
        });
    }
}



function addInputButtonToCpusoc(text, onclick) {


    const button = document.createElement('button');
    button.className = 'SelecteerBetereCpusButton';
    button.textContent = text;
    button.onclick = onclick;

    const buttonContainer = document.querySelector('.SelecteerBetereCpusButtonContainer');
    buttonContainer.appendChild(button);

}

function addStyles(css) {
    const style = document.createElement('style');
    style.innerHTML = css;
    document.head.appendChild(style);
}
  


function loadButtons() {
    addStyles(`
    .SelecteerBetereCpusButtonContainer {
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
        height: 13vh;
    }

    .SelecteerBetereCpusButton {
        color: inherit;
        border: 2px solid green;
        border-radius: 10px; /* Adjust as needed */
        font-weight: bold; /* Makes the text bolder */
        padding: 10px 20px; /* Adjust as needed to make the button round */
        margin-bottom: 10px;
    }
    `);

    const cpuSoc = searchForCpuSoc();
    const parentToOptions = cpuSoc.querySelector('div#specificationFilter_3342');
    const options = parentToOptions.querySelector('div.options');


    const firstUl = options.querySelector('ul');

    const buttonContainer = document.createElement('div');
    buttonContainer.className = 'SelecteerBetereCpusButtonContainer';
    options.insertBefore(buttonContainer, firstUl);

    addInputButtonToCpusoc('Selecteer cpus met een hogere rank', selectCpusWithHigherRank);
    addInputButtonToCpusoc('Alles deselecteren', unselectAllCpus);


    

}

// when the page is loaded, add the buttons to the page
window.onload = loadButtons;
